import React from 'react';

// Image logo
const logo = 'https://images.squarespace-cdn.com/content/v1/5de7be825321a1256af4048a/1665833573454-FPP4JCI5QMBVAJU0MTTI/st-michael-cinema.jpg?format=500w';

export default function AdminVerifyScreen() {
  let navigate = useNavigate(); // Assuming useNavigate is imported from 'react-router-dom'

  return (
    <div style={styles.Setup}>
      <img src={logo} alt="Logo" style={{ width: '400px', height: '225px' }} />

      <div style={styles.SelectionView}>
        <div style={styles.Header}>In order to continue please enter your credentials</div>

        <label style={styles.InputPrompt}>First Name</label>
        <input style={styles.Input} placeholder="First Name" required />

        <label style={styles.InputPrompt}>Last Name</label>
        <input style={styles.Input} placeholder="Last Name" required />

        <label style={styles.InputPrompt}>Passcode</label>
        <input style={styles.Input} placeholder="Passcode" type="password" required />

        <button style={styles.Buttons} onClick={() => navigate('/AdminViewScreen')}>
          <div style={styles.ButtonText}>Submit</div>
        </button>
      </div>
    </div>
  );
}

// Styles
const styles = {
  Setup: {
    backgroundColor: 'white',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    padding: '20px',
  },
  Buttons: {
    backgroundColor: 'orange',
    margin: '10px',
    padding: '10px',
    border: 'none',
    cursor: 'pointer',
  },
  ButtonText: {
    textAlign: 'center',
  },
  SelectionView: {
    borderWidth: '4px',
    borderColor: 'black',
    padding: '5px',
    paddingBottom: '10px',
    margin: '10px',
  },
  HeaderText: {
    fontWeight: 'bold',
    fontSize: '25px',
  },
  TitleText: {
    fontSize: '40px',
    paddingBottom: '50px',
    color: 'grey',
    textAlign: 'center',
  },
  Input: {
    padding: '5px',
    margin: '20px',
    borderWidth: '1px',
    borderStyle: 'solid',
    borderColor: 'grey',
    width: 'calc(100% - 42px)', // Adjust based on padding and margin
  },
  Header: {
    padding: '20px',
    textAlign: 'center',
    fontSize: '20px',
  },
  InputPrompt: {
    color: 'orange',
    fontSize: '15px',
    margin: '30px',
  },
};
